import React from "react";
import { Route, Switch, Redirect } from "react-router-dom";
import DeteilPage, { routeDeteil as routeDeteilPage } from "../../pages/DeteilPage";
import ContactPage, { routeContact as routeContactPage } from "../../pages/ContactPage";
import MainPage, { routeMain as routeMainPage } from "../../pages/MainPage";
import SecondPage, {routeSecond as routeSecondPage} from "../../pages/SecondPage"
import FindPage, {routeFind as routeFindPage} from "../../pages/FindPage"
import "./styles.scss";



import Footer from "../Footer"
import Header from "../Header";



const AppConnect = () =>{
    return (
        <div className="MainWrapper">
          <div className="content ">
      <Header /> 
      <Switch>
      <Route exact path={routeDeteilPage()} component={DeteilPage} />
      <Route exact path={routeContactPage()} component={ContactPage} />
      <Route exact path={routeMainPage()} component={MainPage} />
      <Route exact path={routeSecondPage()} component={SecondPage} />
      <Route exact path={routeFindPage()} component={FindPage} />
      <Redirect
            to={{
              pathname: routeMainPage(),
            }}
          />
      </Switch>
      <Footer/>
      </div>
    </div>
    )
}
export default AppConnect;
